import * as React from 'react';
import instalogo from "./assets/instagram-logo.png"

import PropTypes from 'prop-types';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import CssBaseline from '@mui/material/CssBaseline';
import Divider from '@mui/material/Divider';
import Drawer from '@mui/material/Drawer';
import IconButton from '@mui/material/IconButton';
import InboxIcon from '@mui/icons-material/MoveToInbox';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemIcon from '@mui/icons-material/Explore';
import ListItemText from '@mui/material/ListItemText';
import MailIcon from '@mui/icons-material/Mail';
import MenuIcon from '@mui/icons-material/Menu';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Home from '@mui/icons-material/Home';
import Search from '@mui/icons-material/Search';
import Explore from '@mui/icons-material/Explore';
import Reels from '@mui/icons-material/Slideshow';
import Messages from '@mui/icons-material/Chat';
import Notification from '@mui/icons-material/FavoriteBorder';
import CreatePost from '@mui/icons-material/AddCard';
import Menu from '@mui/icons-material/Menu';

const drawerWidth = 240;

function ResponsiveDrawer() {

  return (
    <div className='leftbar'>
                <img src={instalogo} alt="instalogo"  width={"100px"}/>

          <Divider />
    <ListItem  >
        <ListItemButton>
                <h2 id="but"> <Home fontSize='large'/> Home</h2>
        </ListItemButton>
        <br />
        <ListItemButton>
            <h2 id="but"> <Search fontSize='large'/> Search</h2>
        </ListItemButton>
        <br />

        <ListItemButton>
            <h2 id="but"> <Explore fontSize='large'/> Explore</h2>
        </ListItemButton>
        <br />
        <ListItemButton>
            <h2 id="but"> <Notification fontSize='large'/> Notification</h2>        <br />

        </ListItemButton>
        <br />
        <ListItemButton>
            <h2 id="but"> <CreatePost fontSize='large'/> CreatePost</h2>
        </ListItemButton>
        <br />
        <ListItemButton>
            <h2 id="but"> <Menu fontSize='large'/> Menu</h2>
        </ListItemButton>

              </ListItem>
          <Divider />

        </div>

  );
}



export default ResponsiveDrawer;
